jQuery(document).ready(function(e) {
    e(".popup-gallery").magnificPopup({
        delegate: "a",
        type: "image",
        gallery: {
            enabled: !0
        }
    }), e(".popup-modal").magnificPopup({
        type: "inline",
        preloader: !1,
        focus: "#username",
        modal: !0
    }), e(document).on("click", ".popup-modal-dismiss", function(p) {
        p.preventDefault(), e.magnificPopup.close()
    });
});